const res = fetch("https://api.coincap.io/v2/assets/bitcoin");
const data = res.body.data;
const name = data.name;
const symb = data.symbol;
const price = data.priceUsd;
const change = data.changePercent24Hr;

return (
  <>
    <div>{name}</div>
    <div>{symb}</div>
    <div>$ {price}</div>
    <div>{change} %</div>
  </>
);
